import React from "react";
import BubbleChart from "react-chartjs-2";
const bubbleChartData = {
    datasets: [
      {
        label: "Albums",
        backgroundColor: "#1DB954",
        borderColor: "#1DB954",
        data: [
          { x: "2020-01-01", y: 10, r: 5 },
          { x: "2021-01-01", y: 15, r: 7 },
          { x: "2022-01-01", y: 20, r: 10 },
          { x: "2023-01-01", y: 25, r: 12 },
        ],
      },
    ],
  };


const BubbleChartComponent = () => {
    return <BubbleChart data={bubbleChartData} />;
};


export default BubbleChartComponent;
